// called by the main function to do initial setup, such as uploading vertex
// arrays, shader programs, etc.; returns true if successful, false otherwise
bool setup()
{
    // upload the TAILS model to the GPU (explanations omitted for brevity)
    glGenVertexArrays(1, &tailsVAO);
    glGenBuffers(1, &tailsVBO);
    glBindVertexArray(tailsVAO);
    glBindBuffer(GL_ARRAY_BUFFER, tailsVBO);
    glBufferData(GL_ARRAY_BUFFER, sizeof(tailsVertices), tailsVertices, GL_STATIC_DRAW);

    // // on the VAO, register the current VBO with the following vertex attribute layout:
    // // - the stride length of the vertex array is 12 floats (12 * sizeof(float))
    // // - layout location 0 (position) is 3 floats and starts at the first float of the vertex array (offset 0)
    // // - layout location 1 (color + opacity) is 4 floats and starts at the fourth float (offset 3 * sizeof(float))
    // // - layout location 2 (texcoord) is 2 floats and starts at the eighth float (offset 8 * sizeof(float))
    glVertexAttribPointer(0, 3, GL_FLOAT, GL_FALSE, 12 * sizeof(float), (void*) 0);
    glVertexAttribPointer(1, 4, GL_FLOAT, GL_FALSE, 12 * sizeof(float), (void*) (3 * sizeof(float)));
    glVertexAttribPointer(2, 3, GL_FLOAT, GL_FALSE, 12 * sizeof(float), (void*) (7 * sizeof(float)));
    glVertexAttribPointer(3, 2, GL_FLOAT, GL_FALSE, 12 * sizeof(float), (void*) (10 * sizeof(float)));

    // // enable the layout locations so they can be used by the vertex shader
    glEnableVertexAttribArray(0);
    glEnableVertexAttribArray(1);
    glEnableVertexAttribArray(2);
    glEnableVertexAttribArray(3);

    glGenVertexArrays(1, &sonicVAO);
    glGenBuffers(1, &sonicVBO);
    glBindVertexArray(sonicVAO);
    glBindBuffer(GL_ARRAY_BUFFER, sonicVBO);
    glBufferData(GL_ARRAY_BUFFER, sizeof(sonicVertices), sonicVertices, GL_STATIC_DRAW);

    // on the VAO, register the current VBO with the following vertex attribute layout:
    // - the stride length of the vertex array is 12 floats (12 * sizeof(float))
    // - layout location 0 (position) is 3 floats and starts at the first float of the vertex array (offset 0)
    // - layout location 1 (color + opacity) is 4 floats and starts at the fourth float (offset 3 * sizeof(float))
    // - layout location 2 (texcoord) is 2 floats and starts at the eighth float (offset 8 * sizeof(float))
    glVertexAttribPointer(0, 3, GL_FLOAT, GL_FALSE, 12 * sizeof(float), (void*) 0);
    glVertexAttribPointer(1, 4, GL_FLOAT, GL_FALSE, 12 * sizeof(float), (void*) (3 * sizeof(float)));
    glVertexAttribPointer(2, 3, GL_FLOAT, GL_FALSE, 12 * sizeof(float), (void*) (7 * sizeof(float)));
    glVertexAttribPointer(3, 2, GL_FLOAT, GL_FALSE, 12 * sizeof(float), (void*) (10 * sizeof(float)));

    // enable the layout locations so they can be used by the vertex shader
    glEnableVertexAttribArray(0);
    glEnableVertexAttribArray(1);
    glEnableVertexAttribArray(2);
    glEnableVertexAttribArray(3);

    // upload the CHESS model to the GPU (explanations omitted for brevity)
    glGenVertexArrays(1, &chessVAO);
    glGenBuffers(1, &chessVBO);
    glBindVertexArray(chessVAO);
    glBindBuffer(GL_ARRAY_BUFFER, chessVBO);
    glBufferData(GL_ARRAY_BUFFER, sizeof(chessVertices), chessVertices, GL_STATIC_DRAW);

    // on the VAO, register the current VBO with the following vertex attribute layout:
    // - the stride length of the vertex array is 12 floats (12 * sizeof(float))
    // - layout location 0 (position) is 3 floats and starts at the first float of the vertex array (offset 0)
    // - layout location 1 (color + opacity) is 4 floats and starts at the fourth float (offset 3 * sizeof(float))
    // - layout location 2 (texcoord) is 2 floats and starts at the eighth float (offset 8 * sizeof(float))
    glVertexAttribPointer(0, 3, GL_FLOAT, GL_FALSE, 12 * sizeof(float), (void*) 0);
    glVertexAttribPointer(1, 4, GL_FLOAT, GL_FALSE, 12 * sizeof(float), (void*) (3 * sizeof(float)));
    glVertexAttribPointer(2, 3, GL_FLOAT, GL_FALSE, 12 * sizeof(float), (void*) (7 * sizeof(float)));
    glVertexAttribPointer(3, 2, GL_FLOAT, GL_FALSE, 12 * sizeof(float), (void*) (10 * sizeof(float)));

    // enable the layout locations so they can be used by the vertex shader
    glEnableVertexAttribArray(0);
    glEnableVertexAttribArray(1);
    glEnableVertexAttribArray(2);
    glEnableVertexAttribArray(3);

    // upload the KNUCKLES model to the GPU (explanations omitted for brevity)
    glGenVertexArrays(1, &knucklesVAO);
    glGenBuffers(1, &knucklesVBO);
    glBindVertexArray(knucklesVAO);
    glBindBuffer(GL_ARRAY_BUFFER, knucklesVBO);
    glBufferData(GL_ARRAY_BUFFER, sizeof(knucklesVertices), knucklesVertices, GL_STATIC_DRAW);

    // on the VAO, register the current VBO with the following vertex attribute layout:
    // - the stride length of the vertex array is 12 floats (12 * sizeof(float))
    // - layout location 0 (position) is 3 floats and starts at the first float of the vertex array (offset 0)
    // - layout location 1 (color + opacity) is 4 floats and starts at the fourth float (offset 3 * sizeof(float))
    // - layout location 2 (texcoord) is 2 floats and starts at the eighth float (offset 8 * sizeof(float))
    glVertexAttribPointer(0, 3, GL_FLOAT, GL_FALSE, 12 * sizeof(float), (void*) 0);
    glVertexAttribPointer(1, 4, GL_FLOAT, GL_FALSE, 12 * sizeof(float), (void*) (3 * sizeof(float)));
    glVertexAttribPointer(2, 3, GL_FLOAT, GL_FALSE, 12 * sizeof(float), (void*) (7 * sizeof(float)));
    glVertexAttribPointer(3, 2, GL_FLOAT, GL_FALSE, 12 * sizeof(float), (void*) (10 * sizeof(float)));

    // enable the layout locations so they can be used by the vertex shader
    glEnableVertexAttribArray(0);
    glEnableVertexAttribArray(1);
    glEnableVertexAttribArray(2);
    glEnableVertexAttribArray(3);

    // load our shader program
    shader = gdevLoadShader("demo4.vs", "demo4.fs");
    if (! shader)
        return false;

    // load our texture
    tailsTex = gdevLoadTexture("TailsTexture.png", GL_REPEAT, true, true);
    if (! tailsTex)
        return false;

    chessTex = gdevLoadTexture("ChessTexture.png", GL_REPEAT, true, true);
    if (! chessTex)
        return false;

    sonicTex = gdevLoadTexture("SonicTexture.png", GL_REPEAT, true, true);
    if (! sonicTex)
        return false;

    knucklesTex = gdevLoadTexture("KnucklesTexture.png", GL_REPEAT, true, true);
    if (! knucklesTex)
        return false;

    // enable OpenGL blending so that texels with alpha values less than one are drawn transparent
    // (you can omit these lines if you don't use alpha)
    glEnable(GL_BLEND);
    glBlendFunc(GL_SRC_ALPHA, GL_ONE_MINUS_SRC_ALPHA);

    // the next line will enable z-buffer depth testing to properly draw objects on top of each other
    // (but wait, will this actually work properly with this demo?...)
    glEnable(GL_DEPTH_TEST);

    return true;
}

// called by the main function to do rendering per frame

void render()
{

    // randomizes the random seed
    srand(glfwGetTime()*1000);

    // find the elapsed time since the last frame
    double currentTime = glfwGetTime();
    double deltaTime = currentTime - previousTime;
    float cameraSpeed = deltaTime * 20;
    previousTime = currentTime;
    
    //MOVEMENT CONTROLS
    if (glfwGetKey(pWindow, GLFW_KEY_W) == GLFW_PRESS)
        cameraPos += cameraSpeed * cameraFront;
    if (glfwGetKey(pWindow, GLFW_KEY_S) == GLFW_PRESS)
        cameraPos -= cameraSpeed * cameraFront;
    if (glfwGetKey(pWindow, GLFW_KEY_A) == GLFW_PRESS)
        cameraPos -= glm::normalize(glm::cross(cameraFront, cameraUp)) * cameraSpeed;
    if (glfwGetKey(pWindow, GLFW_KEY_D) == GLFW_PRESS)
        cameraPos += glm::normalize(glm::cross(cameraFront, cameraUp)) * cameraSpeed;
    if (glfwGetKey(pWindow, GLFW_KEY_E) == GLFW_PRESS) 
        cameraPos += cameraSpeed * cameraUp;
    if (glfwGetKey(pWindow, GLFW_KEY_Q) == GLFW_PRESS) 
        cameraPos -= cameraSpeed * cameraUp;

    // clear the whole frame
    glClearColor(0.0f, 0.3f, 0.3f, 1.0f);
    glClear(GL_COLOR_BUFFER_BIT | GL_DEPTH_BUFFER_BIT);

    // using our shader program...
    glUseProgram(shader);

    // ... set up the projection matrix...
    glm::mat4 projectionTransform;
    projectionTransform = glm::perspective(glm::radians(fov),                   // fov
                                           (float) WINDOW_WIDTH / WINDOW_HEIGHT,  // aspect ratio
                                           0.1f,                                  // near plane
                                           200.0f);                               // far plane
    glUniformMatrix4fv(glGetUniformLocation(shader, "projectionTransform"),
                       1, GL_FALSE, glm::value_ptr(projectionTransform));

    // ... set up the view matrix...
    glm::mat4 viewTransform;
    viewTransform = glm::lookAt(cameraPos,   // eye position
                                cameraPos + cameraFront,   // center position
                                cameraUp);  // up vector

    glUniformMatrix4fv(glGetUniformLocation(shader, "viewTransform"),
                       1, GL_FALSE, glm::value_ptr(viewTransform));

    // Tails Matrix Transformations
    std::vector<std::pair<int, int>> validMoves;
    std::vector<float> validAngles;
    int newRow, newColumn;
    for (int i = 0; i < 2; i++) {

        validMoves.clear();
        validAngles.clear();

        tailsInstances[i].t += deltaTime;

        for(unsigned int j=0; j<knightMoves.size(); j++) {
            newRow = tailsInstances[i].row + knightMoves[j].first;
            newColumn = tailsInstances[i].column + knightMoves[j].second;
            if(newRow >= 0 && newRow < 8 && newColumn >= 0 && newColumn < 8) {
                validMoves.push_back({knightMoves[j].first, knightMoves[j].second});
                validAngles.push_back(knightAngles[j]);
            }
        }

        if (tailsInstances[i].state == 0){
            if (tailsInstances[i].t >= 0.3f) {
                tailsInstances[i].nextMove = rand() % validMoves.size();
                tailsInstances[i].state = 1;
                tailsInstances[i].t = 0;
            }
        }

        // ... set up the model matrix...
        glm::mat4 modelTransform = glm::mat4(1.0f);  // set to identity first
        modelTransform = glm::translate(modelTransform,
                                    glm::vec3(tailsInstances[i].x, tailsInstances[i].y, tailsInstances[i].z)); // translate xyz
        if (tailsInstances[i].state == 2) {
            float time1 = 1.0f;
            
            modelTransform = glm::translate(modelTransform, 
                                            glm::vec3(validMoves[tailsInstances[i].nextMove].second * tileWidth * (tailsInstances[i].t / time1), 
                                                      sin(PI * tailsInstances[i].t / 1.0f) * 10.0f, 
                                                      validMoves[tailsInstances[i].nextMove].first * tileWidth * (tailsInstances[i].t / time1)));
            if (tailsInstances[i].t >= time1) {
                tailsInstances[i].state = 0;
                tailsInstances[i].t = 0;
                tailsInstances[i].row += validMoves[tailsInstances[i].nextMove].first;
                tailsInstances[i].column += validMoves[tailsInstances[i].nextMove].second;
                tailsInstances[i].x = originX + tailsOffsetX + tailsInstances[i].column * tileWidth;
                tailsInstances[i].z = originZ + tailsOffsetZ + tailsInstances[i].row * tileWidth;
            } 
        }

        modelTransform = glm::rotate(modelTransform,
                                    glm::radians(tailsInstances[i].rotation),
                                    glm::vec3(0.0f, 1.0f, 0.0f));
        if (tailsInstances[i].state == 1) {
            
            float turnAngle = validAngles[tailsInstances[i].nextMove] - tailsInstances[i].rotation - 90.0f;
            if(fabs(turnAngle) > 180) {
                turnAngle = 360 - fabs(turnAngle);
            }
            float time2 = 1.0f * fabs(turnAngle) / 180.0;
            modelTransform = glm::rotate(modelTransform, 
                                         glm::radians(turnAngle * (tailsInstances[i].t / time2)),
                                         glm::vec3(0.0f, 1.0f, 0.0f));

            if (tailsInstances[i].t >= time2) {
                tailsInstances[i].state = 2;
                tailsInstances[i].rotation = validAngles[tailsInstances[i].nextMove] - 90;
                tailsInstances[i].t = 0;    
            }
        }
        if(tailsInstances[i].state == 2) {
            modelTransform = glm::rotate(modelTransform,
                                        glm::radians(-360.0f * tailsInstances[i].t),
                                        glm::vec3(0.0f, 0.0f, 1.0f));
        }
        modelTransform = glm::scale(modelTransform,
                                    glm::vec3(tailsInstances[i].scaling, tailsInstances[i].scaling, tailsInstances[i].scaling));   // scale x and y
        
        //Rotate state
        

        glUniformMatrix4fv(glGetUniformLocation(shader, "modelTransform"),
                        1, GL_FALSE, glm::value_ptr(modelTransform));
        // ... set the active texture...
        glActiveTexture(GL_TEXTURE0);
        glBindTexture(GL_TEXTURE_2D, tailsTex);
        //new
        glUniform1i(glGetUniformLocation(shader, "tailsTexture"), 0);

        // Set the uniform to use Tails' texture
        glUniform1i(glGetUniformLocation(shader, "useTexture"), 0);

        // ... then draw our triangles
        glBindVertexArray(tailsVAO);
        glDrawArrays(GL_TRIANGLES, 0, sizeof(tailsVertices) / (8 * sizeof(float)));

    }

    // Sonic Movement Speed and Range Limit
    // static int sonicState = 0; // track sonic's movement state
    // 0 - forward diagonal right, 1 - 
    float sonicSpeed = 1.5f;
    float moveSonic = glfwGetTime() * sonicSpeed;
    float range = 7.0f; // Limit movement range
    float movementDirection[2] = {1.0f, -1.0f}; // an array of movement multipliers that allows the sonic's to move in different directions
    // Sonic Matrix Transformations
    for (int i = 0; i < 2; i++)
    {

        // Calculate movement with stopping condition
        float moveX = sonicInstances[i].x + movementDirection[i] * moveSonic;
        float moveZ = sonicInstances[i].z + movementDirection[i] * moveSonic;


        // Stop movement if it reaches the range
        if (fabs(moveX - sonicInstances[i].x) > range)
            moveX = sonicInstances[i].x + movementDirection[i] * range;


        if (fabs(moveZ - sonicInstances[i].z) > range)
            moveZ = sonicInstances[i].z + movementDirection[i] * range;


        // Set up the model transformation matrix
        glm::mat4 modelTransform = glm::mat4(1.0f);
        modelTransform = glm::translate(modelTransform, 
                                    glm::vec3(moveX, sonicInstances[i].y, moveZ));
        modelTransform = glm::rotate(modelTransform, 
                                    sonicInstances[i].rotation, 
                                    glm::vec3(1.0f, 0.0f, 0.0f));                                  // rotate around x
        modelTransform = glm::rotate(modelTransform, 
                                    sonicInstances[i].rotation, 
                                    glm::vec3(0.0f, 0.0f, 1.0f));                                  // rotate around z
        modelTransform = glm::rotate(modelTransform, 
                                    sonicInstances[i].newRotate, 
                                    glm::vec3(0.0f, 1.0f, 0.0f));                                  // rotate around y
        modelTransform = glm::scale(modelTransform, 
                                    glm::vec3(sonicInstances[i].scaling, sonicInstances[i].scaling, 1.0f));

        glUniformMatrix4fv(glGetUniformLocation(shader, "modelTransform"), 1, GL_FALSE, glm::value_ptr(modelTransform));

        // ... set the active texture...
        glActiveTexture(GL_TEXTURE0);
        glBindTexture(GL_TEXTURE_2D, sonicTex);
 
        glUniform1i(glGetUniformLocation(shader, "sonicTexture"), 0);

        // Set the uniform to use texture
        glUniform1i(glGetUniformLocation(shader, "useTexture"), 0);

        // ... then draw our triangles
        glBindVertexArray(sonicVAO);
        glDrawArrays(GL_TRIANGLES, 0, sizeof(sonicVertices) / (8 * sizeof(float)));
    }

    // Knuckles Matrix Transformations
    for (int i = 0; i < 2; i++)
    {
        // Set up the model transformation matrix
        glm::mat4 modelTransform = glm::mat4(1.0f);
        modelTransform = glm::translate(modelTransform, 
                                    glm::vec3(knucklesInstances[i].x, knucklesInstances[i].y, knucklesInstances[i].z));
        modelTransform = glm::rotate(modelTransform, 
                                    knucklesInstances[i].rotation, 
                                    glm::vec3(1.0f, 0.0f, 0.0f));                                  // rotate around x
        modelTransform = glm::rotate(modelTransform, 
                                    knucklesInstances[i].rotation, 
                                    glm::vec3(0.0f, 0.0f, 1.0f));                                  // rotate around z
        modelTransform = glm::rotate(modelTransform, 
                                    knucklesInstances[i].newRotate, 
                                    glm::vec3(0.0f, 1.0f, 0.0f));                                  // rotate around y
        modelTransform = glm::scale(modelTransform, 
                                    glm::vec3(knucklesInstances[i].scaling, knucklesInstances[i].scaling, 1.0f));

        glUniformMatrix4fv(glGetUniformLocation(shader, "modelTransform"), 1, GL_FALSE, glm::value_ptr(modelTransform));

        // ... set the active texture...
        glActiveTexture(GL_TEXTURE0);
        glBindTexture(GL_TEXTURE_2D, knucklesTex);
 
        glUniform1i(glGetUniformLocation(shader, "knucklesTexture"), 0);

        // Set the uniform to use texture
        glUniform1i(glGetUniformLocation(shader, "useTexture"), 0);

        // ... then draw our triangles
        glBindVertexArray(knucklesVAO);
        glDrawArrays(GL_TRIANGLES, 0, sizeof(knucklesVertices) / (8 * sizeof(float)));
    }


    // Chess Matrix Transformations
    for (int i = 0; i < 1; i++)
    {
        // ... set up the model matrix...
        glm::mat4 modelTransform = glm::mat4(1.0f);  // set to identity first
        modelTransform = glm::translate(modelTransform,
                                        glm::vec3(chessInstances[i].x, chessInstances[i].y, chessInstances[i].z)); // translate xyz
        modelTransform = glm::rotate(modelTransform,
                                     chessInstances[i].rotation,
                                     glm::vec3(0.0f, 0.0f, 1.0f));                                  // rotate around z
        modelTransform = glm::scale(modelTransform,
                                    glm::vec3(chessInstances[i].scaling * 0.4f, chessInstances[i].scaling * 0.4f, 1.0f * 0.4f));   // scale x and y
        glUniformMatrix4fv(glGetUniformLocation(shader, "modelTransform"),
                        1, GL_FALSE, glm::value_ptr(modelTransform));

        // ... set the active texture...
        glActiveTexture(GL_TEXTURE0);
        glBindTexture(GL_TEXTURE_2D, chessTex);
        //new
        glUniform1i(glGetUniformLocation(shader, "chessTexture"), 0);

        // Set the uniform to use texture
        glUniform1i(glGetUniformLocation(shader, "useTexture"), 0);

        // ... then draw our triangles
        glBindVertexArray(chessVAO);
        glDrawArrays(GL_TRIANGLES, 0, sizeof(chessVertices) / (8 * sizeof(float)));
    }
   

}

